      <Box textAlign={"left"} marginLeft={"30px"}>
        <Text>Остались вопросы?</Text>
      </Box>
      <Box
        display={"flex"}
        flexDirection={"row"}
        gap={"20px"}
        margin={"0 auto"}
      >
        <Box></Box>
        <Text>Пиши!</Text>
        {/* <ButtonRed text={"Перейти в Telegram"} /> */}
      </Box>
    </Box>
  );
}

export default Footer;
